import { Button } from "@mui/material";
import React, {useState} from "react";
import styled from 'styled-components'

export default function Todo() {
    const [count, setTodo] = useState(0)
    return (<div>
        <h1>todo 페이지</h1>
        <p>할 일: {count >=0 ? count : useState(0)}</p>
        <Button variant="outlined" onClick={() => setTodo(count + 1)}>추가</Button>
        <Button variant="outlined" onClick={() => setTodo(count - 1)}>삭제</Button>
    </div>)
}
